 HUMXR_SHIP_Cinema32: "Serial Experiment" # "Serial Experiment Lain", an anime in which transhumanist ideology and the future of computing are looked at through the lens of a 1990s autistic girl in Japan. Weird but good; If you think of it like a dream where her view of what had happened to her involving tech in real life, it not only reflects the infamiliarity with technology and the relevant thoughts on it of the time (the strangeness and the implication it would grow beyond anyone's control), but was also remarkably prescient of then-future (contemporary in 2025) aspects of the same (the idea it "should" be mundane, that people isolated to the point of social atomization, and that like an organism it has evolved over time, or that the "god of the wired" could vaguely represent the modern "Insane Plutocrat Tech Bro" such as the infamous "Spez", Zuckerburg, Musk and Bezos). Open to interpretation, very artsy, might not be your thing (I barely understood it) but better than it sounds.
